window.bookSummaryJSON = "<p>The Fae Magic bundle set includes all four books in the series full of non-stop action, adventure, magic, and irresistible romance.</p> <p>What is magic?</p> <p>My name is Saraphina Proctor...</p> <p>and that’s the only thing I can remember.</p> <p>I woke up alone, surrounded by darkness with no memory.</p> <p>No one here knows who I am, I don’t fit any of the missing persons reports, and the doctors can’t find a single thing wrong with me…my memory…my life…they’re just…gone.</p> <p>But something lurks in the shadows in Salem, watching me…waiting.</p> <p>I feel its eyes on my back and my name whispered in the wind.</p> <p>Even in the light of day the friendly smiles around town put me on edge.</p> <p>Someone isn’t telling me the truth but I will find out what happened to me…and I think Riah knows more than his pretty mouth is telling me.</p> <p>There's a story in those golden eyes of his, now I just need to get close enough to him to find out…*Disclaimer:</p> <p>Fae Magic is Season Three in The Coven Saga.</p> <p>It can be read as a standalone but is best to be read after Season One - Elemental Magic and Season Two Academy Magic.</p> <p>Titles include:</p> <p>The Cursed Witch, The Rogue Witch, The Rotten Witch, The Death Witch</p> <p>Featuring a fiery half-breed, a brooding fae knight, and a secret romance cursed to time, fans of The Mortal Instruments, Twilight, or Harry Potter will love Chandelle LaVaun’s brand new urban fantasy series!</p> <p>Thousands of copies sold.</p> <p>Millions of pages read.</p> <p>500+ five-star reviews for the series.</p>"; 
